        return <ListItem sx={{ width:"50%", border: 1, borderRadius:"12px", borderColor:"grey.500",padding:"0%", margin:"3%"}}>
            <ListItemText key={key} sx={{textAlign:"center", padding:"0%"}}>{i}</ListItemText>
        </ListItem>;
    });
    return ( 
        items
     );
}

export default flowchartItems;
